__NUXT_JSONP__("/en/categories/Bezienswaardigheden", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n){c.id=d;c.name="Fiets- en wandelstartpunt Hippolytushoef";c.name_en="Cycling and walking starting point Hippolytushoef";c.name_de="Ausgangspunkt für Rad- und Wandertouren";c.coordinates="52.90693191602117, 4.961311405035104";c.enabled=a;c.category=b;e.id=f;e.name="Fiets- en wandelstartpunt Den Oever";e.name_en="Cycling and walking starting point Den Oever";e.name_de="Ausgangspunkt für Rad- und Wandertouren Den Oever";e.coordinates="52.93029966957933, 5.031214240429179";e.enabled=a;e.category=b;return {data:[{category:b,locations:[{id:"62e97341cb24f8f4fa9997b8",name:"Peilhuisje Quarantaine",name_en:" Sentinel house Quarantaine",name_de:" Sentinel-Haus Quarantaine",coordinates:"52.894111361080775, 4.908735906373444",description:"\u003Cp\u003EHet peilschaalhuisje in Westerland is een van de twee peilschaalhuisjes op Wieringen. De andere staat in de Vissershaven van Den Oever. Beide peilschaalhuisjes dateren uit het jaar 1919. Toen werden ze gebouwd in opdracht van Rijkswaterstaat. De peilschaalhuisjes werden ingezet om de waterstand vast te leggen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVanuit dit huisje vond de controle plaats van de waterstand ten behoeve van de dijkbewaking. Een of meerdere keren per dag werd hier de beweging van het water gemeten. Na de oorlog nam de computer het meetwerk over en zijn de meeste huisjes onbruik geraakt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDoor het afsluiten van de Zuiderzee begon het noordelijk gebied van Wieringen te verzanden. De eb en vloedstromen die het betrokken gebied op diepte hielden veranderden naarmate de afsluiting vorderde. De stromingen werden als het ware gedwongen een ander richting te kiezen. De verzanding nam op een gegeven moment dusdanige vormen aan dat de waterhoogte, aan de Quarantaineweg niet meer kon worden gemeten. In 1939 werd de apparatuur uit het huisje verwijderd, het huisje heeft nog jarenlang dienst gedaan als schuilonderkomen voor mensen die tijdens zware storm wacht liepen op de dijken.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EHet peilschaalhuis aan de haven van Den Oever heeft nog jarenlang de taak overgenomen van de verzandde peilschaal aan de Quarantaineweg, tot tenslotte reeds voor de oorlog ook deze in onbruik raakte, wanneer hier de apparatuur is verwijderd is niet bekend.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe gauge house in Westerland is one of the two gauge houses on Wieringen. The other is located in the fishing port of Den Oever. Both gauge houses date from 1919, when they were built on behalf of Rijkswaterstaat. The gauge houses were used to record the water level.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EThe water level was monitored from this house for dike monitoring purposes. The movement of the water was measured here once or several times a day. After the war, the computer took over the measuring work and most of the houses have fallen into disuse.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDue to the closure of the Zuiderzee, the northern area of ​​Wieringen started to silt up. The ebb and flow currents that kept the affected area at depth changed as the closure progressed. The currents were, as it were, forced to choose a different direction. At a certain point, the silting up took on such forms that the water level on the Quarantaineweg could no longer be measured. The equipment was removed from the house in 1939. The house served for many years as a shelter for people who stood watch on the dikes during a heavy storm.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EThe sounding scale house at the harbor of Den Oever took over the task of the silted measuring scale on the Quarantaineweg for many years, until finally even before the war it fell into disuse, when the equipment was removed is not known.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDas Pegelhaus in Westerland ist eines der beiden Pegelhäuser auf Wieringen. Der andere befindet sich im Fischereihafen von Den Oever. Beide Pegelhäuser stammen aus dem Jahr 1919, als sie im Auftrag von Rijkswaterstaat gebaut wurden. Die Pegelhäuser dienten der Erfassung des Wasserstandes.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EZur Deichüberwachung wurde von diesem Haus aus der Wasserstand überwacht. Hier wurde ein- bis mehrmals täglich die Bewegung des Wassers gemessen. Nach dem Krieg übernahm der Computer die Vermessungsarbeit und die meisten Häuser wurden nicht mehr genutzt.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAufgrund der Sperrung der Zuiderzee kam es im nördlichen Bereich von Wieringen zu einer Versandung. Die Ebbe- und Flutströmungen, die das betroffene Gebiet in der Tiefe hielten, änderten sich mit fortschreitender Sperrung. Die Strömungen wurden gewissermaßen gezwungen, eine andere Richtung zu wählen. Ab einem bestimmten Zeitpunkt nahm die Versandung solche Ausmaße an, dass der Wasserstand auf dem Quarantaineweg nicht mehr gemessen werden konnte. Die Geräte wurden 1939 aus dem Haus entfernt. Das Haus diente viele Jahre lang als Unterschlupf für Menschen, die während eines schweren Sturms auf den Deichen Wache standen.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDas Peilhaus am Hafen von Den Oever übernahm viele Jahre lang die Aufgabe der verschlammten Messwaage am Quarantaineweg, bis es schließlich noch vor dem Krieg außer Betrieb geriet. Wann die Ausrüstung entfernt wurde, ist nicht bekannt.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62e9738fcb24f8f4fa9997b9",name:"Hoogste punt van Wieringen",name_en:"The Highest Point of Wieringen",name_de:"Der höchste Punkt von Wieringen",coordinates:"52.8938543902826, 4.923507240209394",description:"\u003Cp\u003EHet Hoogste punt van Wieringen biedt een adembenemend uitzicht over het eiland en de omringende gebieden. Het is een ideale plek voor wandelaars en natuurliefhebbers die van panoramische vergezichten houden. Op heldere dagen kun je zelfs het omliggende Waddengebied zien. Bezoekers kunnen hier ook meer te weten komen over de geologie en geografie van Wieringen. Mis de kans niet om het Hoogste punt van Wieringen te bezoeken voor een onvergetelijke ervaring.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe highest point of Wieringen offers a breathtaking view over the island and the surrounding areas. It is an ideal place for hikers and nature lovers who enjoy panoramic views. On clear days you can even see the surrounding Wadden area. Visitors can also learn more about the geology and geography of Wieringen here. Don't miss the chance to visit the highest point of Wieringen for an unforgettable experience.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer höchste Punkt von Wieringen bietet einen atemberaubenden Ausblick über die Insel und die umliegenden Gebiete. Es ist ein idealer Ort für Wanderer und Naturliebhaber, die den Panoramablick genießen. An klaren Tagen können Sie sogar das umliegende Wattengebiet sehen. Besucher können hier auch mehr über die Geologie und Geographie von Wieringen erfahren. Verpassen Sie nicht die Gelegenheit, den höchsten Punkt von Wieringen zu besuchen und ein unvergessliches Erlebnis zu erleben.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62e973b6cb24f8f4fa9997ba",name:"Lutjestrand",name_en:"Beach (Lutjestrand)",name_de:" Strand (Lutjestrand)",coordinates:"52.88792065376204, 4.914078993160453",description:"\u003Cp\u003ELutjestrand is mogelijk het oudste strand van Noord-Holland, met zand dat meer dan 100.000 jaar oud is. Dit recreatiestrandje ligt aan het prachtige Amstelmeer in de Kop van Noord-Holland. Het strand beschikt over speciale zones voor kitesurfen, windsurfen en ontspanning op het zandstrand. Voor verschillende leeftijden zijn er speeltoestellen, zoals een watertafel en een volleybalnet. Het zandstrand heeft ook een zwembassin, zodat je altijd veilig kunt zwemmen zonder last te hebben van blauwalgen. Langs het zwembassin kun je aanmeren met een sloepje. Lutjestrand is de ideale plek voor recreatie en watersporten zoals varen, suppen, kiten en windsurfen - alles is hier mogelijk!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ELutjestrand is possibly the oldest beach in North Holland, with sand that is over 100,000 years old. This recreational beach is located on the beautiful Amstelmeer in the Kop van Noord-Holland. The beach offers designated areas for kitesurfing, windsurfing, and relaxation on the sandy beach. There are various play equipment suitable for different age groups, such as a water table and a volleyball net. The sandy beach also features a swimming basin, providing a safe place to swim without the presence of blue-green algae. Alongside the basin, you can dock a small boat. Lutjestrand is the perfect spot for recreation and water sports, including boating, stand-up paddling, kiteboarding, and windsurfing - everything is possible here!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003ELutjestrand ist möglicherweise der älteste Strand Nordhollands mit über 100.000 Jahre altem Sand. Dieser Freizeitstrand liegt am wunderschönen Amstelmeer im Kop van Noord-Holland. Der Strand bietet ausgewiesene Bereiche zum Kitesurfen und Windsurfen sowie zum Entspannen am Sandstrand. Es gibt verschiedene Spielgeräte für verschiedene Altersgruppen, wie zum Beispiel einen Wassertisch und ein Volleyballnetz. Am Sandstrand gibt es auch ein Schwimmbecken, das einen sicheren Ort zum Schwimmen ohne Blaualgen bietet. Neben dem Becken können Sie ein kleines Boot anlegen. Lutjestrand ist der perfekte Ort für Erholung und Wassersport, darunter Bootfahren, Stand-Up-Paddeln, Kiteboarden und Windsurfen – hier ist alles möglich!\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4577b974cb2998dd110b",name:"Zandkuilweg",coordinates:"52.89256706469678, 4.916956369218754",description:"\u003Cp\u003EDe Zandkuilweg is een schilderachtige route op Wieringen die je meeneemt door het prachtige landschap van het voormalige eiland. De weg voert je langs weidse velden, schilderachtige boerderijen en historische dijken. Het is een geweldige plek om te wandelen of te fietsen en te genieten van de rust en de natuur. Onderweg kom je misschien wel een kudde schapen tegen die vredig graast in de groene weilanden. Laat je betoveren door de landelijke charme van de Zandkuilweg terwijl je geniet van de serene ambiance van dit prachtige gebied.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Zandkuilweg is a picturesque route on Wieringen that takes you through the beautiful landscape of the former island. The road leads you along vast fields, picturesque farms, and historic dikes. It's a great place for walking or cycling and enjoying the tranquility and nature. Along the way, you might encounter a flock of sheep peacefully grazing in the green meadows. Let yourself be enchanted by the rural charm of the Zandkuilweg while reveling in the serene ambiance of this beautiful area.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Zandkuilweg ist eine malerische Route auf Wieringen, die Sie durch die wunderschöne Landschaft der ehemaligen Insel führt. Die Straße führt entlang weiter Felder, malerischer Bauernhöfe und historischer Deiche. Es ist ein großartiger Ort zum Wandern oder Radfahren und zum Genießen von Ruhe und Natur. Unterwegs könnten Sie auf eine Herde Schafe stoßen, die friedlich in den grünen Wiesen grasen. Lassen Sie sich von dem ländlichen Charme der Zandkuilweg verzaubern, während Sie die friedliche Atmosphäre dieser wunderschönen Gegend genießen.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee45b2b974cb2998dd110c",name:"Westerlander Koog",coordinates:"52.88648538198326, 4.923295047003467",description:"\u003Cp\u003EWesterlander Koog is een prachtig natuurgebied op Wieringen, dat bekend staat om zijn diverse flora en fauna. Het gebied bestaat uit moerassen, rietvelden, en waterplassen, waardoor het een ideale leefomgeving is voor vele vogels en andere dieren. Een wandeling door Westerlander Koog biedt een unieke kans om talloze vogelsoorten te observeren, waaronder weidevogels, watervogels, en roofvogels. Ook is het mogelijk om schapen te zien grazen in de omliggende weilanden. Vergeet je verrekijker niet mee te nemen om volop te genieten van de prachtige natuur en de diverse diersoorten die hier te bewonderen zijn.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EWesterlander Koog is a beautiful nature reserve on Wieringen, renowned for its diverse flora and fauna. The area comprises marshes, reed fields, and water pools, making it an ideal habitat for many birds and other animals. A walk through Westerlander Koog offers a unique opportunity to observe countless bird species, including meadow birds, waterfowl, and birds of prey. You may also see sheep grazing in the surrounding meadows. Don't forget to bring your binoculars to fully enjoy the stunning nature and the various animal species that can be admired here.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Westerlander Koog ist ein wunderschönes Naturschutzgebiet auf Wieringen, das für seine vielfältige Flora und Fauna bekannt ist. Das Gebiet besteht aus Mooren, Schilffeldern und Wasserpfützen und bietet somit einen idealen Lebensraum für viele Vögel und andere Tiere. Ein Spaziergang durch den Westerlander Koog bietet eine einzigartige Gelegenheit, unzählige Vogelarten zu beobachten, darunter Wiesenvögel, Wasservögel und Greifvögel. Möglicherweise sieht man auch Schafe, die in den umliegenden Wiesen grasen. Vergessen Sie nicht, Ihr Fernglas mitzubringen, um die atemberaubende Natur und die verschiedenen Tierarten, die hier bewundert werden können, in vollen Zügen zu genießen.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4639b974cb2998dd110d",name:"Eendenkooi",name_en:"Duck Decoy",name_de:"Entenköder",coordinates:"52.89437870657819, 4.942364059485017",description:"\u003Cp\u003EDe Eendenkooi op Wieringen is een unieke plek waar eenden werden gevangen voor consumptie. Het is een historische vangmethode die teruggaat tot de middeleeuwen. Bezoekers kunnen hier meer te weten komen over de eeuwenoude traditie van eenden vangen en hoe dit vroeger in zijn werk ging. Het is ook een prachtige plek om van de natuur te genieten en diverse vogelsoorten te spotten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Duck Decoy on Wieringen is a unique location where ducks were captured for consumption. It is a historical trapping method that dates back to the Middle Ages. Visitors can learn more about the centuries-old tradition of duck catching and how it used to work. It is also a beautiful place to enjoy nature and spot various bird species.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Eendenkooi auf Wieringen ist ein einzigartiger Ort, an dem Enten für den Verzehr gefangen wurden. Es handelt sich um eine historische Fangmethode, die bis ins Mittelalter zurückreicht. Besucher können hier mehr über die jahrhundertealte Tradition des Entenfangens erfahren und wie es früher funktionierte. Es ist auch ein wunderschöner Ort, um die Natur zu genießen und verschiedene Vogelarten zu beobachten.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee465bb974cb2998dd110e",name:"De steen van Westerklief",name_en:"The Westerklief stone",name_de:" Der Westerkliefstein",coordinates:"52.89770512547304, 4.952907719058381",description:"\u003Cp\u003EDit is een oud deel van Wieringen, waar overwegend boeren woonden. De klieven behoren tot de hogere delen van Wieringen. De Varkensgrasweg en de Hoelm liggen tussen Westerklief en Westerland. Westerklief is bekend geworden door de “stien.“ Deze steen dateert uit de voorlaatste ijstijd en is één van de grootste uit deze periode. Van de stien werd aan de kinderen verteld dat deze zich zou omkeren als hij de klok hoorde slaan. Veel kinderen hebben daar tevergeefs op gewacht.&nbsp;\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThis is an old part of Wieringen, where mainly farmers lived. The clefts belong to the higher parts of Wieringen. The Varkensgrasweg and the Hoelm are located between Westerklief and Westerland. Westerklief is known for the \"stien.\" This stone dates from the penultimate ice age and is one of the largest from this period. The children were told that the stien would turn when he heard the clock chime. Many children have waited in vain for this.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDies ist ein alter Teil von Wieringen, wo hauptsächlich Bauern lebten. Die Klüfte gehören zu den höheren Lagen von Wieringen. Der Varkensgrasweg und die Hoelm liegen zwischen Westerklief und Westerland. Westerklief ist bekannt für den „Stien.“ Dieser Stein stammt aus der vorletzten Eiszeit und ist einer der größten aus dieser Zeit. Den Kindern wurde gesagt, dass sich der Stien drehen würde, wenn er die Uhr läuten hörte. Darauf haben viele Kinder vergeblich gewartet.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4688b974cb2998dd110f",name:"Vindplaats Vikingschat",name_en:"The Viking Treasure Discovery Site",name_de:"Die Vindplaats Vikingschat",coordinates:"52.89551032381738, 4.947517256835575",description:"\u003Cp\u003EDe Vindplaats Vikingschat is een archeologische site op Wieringen waar een schat aan Vikingvondsten werd ontdekt. Deze vondsten werpen nieuw licht op de geschiedenis van de Vikingen in Nederland. Bezoekers kunnen hier meer leren over de fascinerende geschiedenis van de Vikingen en de rol die Wieringen speelde in deze periode. De tentoonstelling toont een indrukwekkende verzameling artefacten, zoals sieraden, wapens en gebruiksvoorwerpen. Kom naar de Vindplaats Vikingschat en duik in het verleden van de Vikingen in dit boeiende historische centrum.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Viking Treasure Discovery Site is an archaeological site on Wieringen where a treasure trove of Viking findings was uncovered. These discoveries shed new light on the history of the Vikings in the Netherlands. Visitors can learn more about the fascinating history of the Vikings and the role Wieringen played during this period. The exhibition showcases an impressive collection of artifacts, including jewelry, weapons, and everyday objects. Come to the Viking Treasure Discovery Site and delve into the past of the Vikings in this captivating historical center.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Vindplaats Vikingschat ist eine archäologische Stätte auf Wieringen, wo ein wahrer Schatz an Fundstücken der Wikinger entdeckt wurde. Diese Entdeckungen werfen neues Licht auf die Geschichte der Wikinger in den Niederlanden. Besucher können hier mehr über die faszinierende Geschichte der Wikinger und die Rolle erfahren, die Wieringen während dieser Zeit spielte. Die Ausstellung präsentiert eine beeindruckende Sammlung von Artefakten, darunter Schmuck, Waffen und Alltagsgegenstände. Besuchen Sie die Vindplaats Vikingschat und tauchen Sie in die Vergangenheit der Wikinger in diesem fesselnden historischen Zentrum ein.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee46adb974cb2998dd1110",name:"Oude Zeedijk 'Wierdijk'",name_en:"Old sea dike 'Wierdijk'",name_de:"Alter Seedeich 'Wierdijk'",coordinates:"52.89022802999927, 4.9419844325977484",description:"\u003Cp\u003EDe Oude Zeedijk, ook bekend als 'Wierdijk', is een historische dijk die Wieringen al eeuwenlang beschermt tegen de kracht van de zee. Deze robuuste dijk vertelt het verhaal van de eeuwige strijd tegen overstromingen en het belang van waterbeheer in deze regio. Bezoekers kunnen hier meer te weten komen over de bouw en het onderhoud van de dijk en de rol die het speelt in het behoud van het landschap. De Oude Zeedijk is een belangrijk erfgoed dat de moeite waard is om te verkennen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Oude Zeedijk, also known as 'Wierdijk', is a historic dike that has been protecting Wieringen against the force of the sea for centuries. This robust dike tells the story of the eternal battle against flooding and the importance of water management in this region. Visitors can learn more about the construction and maintenance of the dike and the role it plays in preserving the landscape. The Oude Zeedijk is an important heritage site worth exploring.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Oude Zeedijk, auch „Wierdijk“ genannt, ist ein historischer Deich, der Wieringen seit Jahrhunderten vor der Kraft des Meeres schützt. Dieser robuste Deich erzählt die Geschichte des ewigen Kampfes gegen Überschwemmungen und der Bedeutung der Wasserbewirtschaftung in dieser Region. Besucher können mehr über den Bau und die Instandhaltung des Deiches und seine Rolle bei der Erhaltung der Landschaft erfahren. Der Oude Zeedijk ist ein wichtiges Kulturerbe, das einen Besuch wert ist.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee46f5b974cb2998dd1111",name:"Vogeluitkijk op de de dijk",name_en:"Bird Observation Point on the Dike",name_de:"Der Vogeluitkijk op de dijk",coordinates:"52.90555681966286, 4.9411265301123795",description:"\u003Cp\u003EDe Vogeluitkijk op de dijk biedt vogelliefhebbers een geweldige kans om verschillende vogelsoorten in hun natuurlijke habitat te observeren. Gelegen op de dijk, geeft dit uitkijkpunt een panoramisch uitzicht over de Waddenzee en de omliggende wetlands. Tijdens migratieseizoenen kun je hier talrijke trekvogels zien, waaronder ganzen, steltlopers en eenden. Breng je verrekijker mee en geniet van het schouwspel van kleurrijke vogels die foerageren en rusten in deze belangrijke vogelrustplaats. Het is een paradijs voor vogelaars en natuurliefhebbers.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Bird Observation Point on the Dike offers bird enthusiasts an excellent opportunity to observe various bird species in their natural habitat. Located on the dike, this viewpoint provides a panoramic view of the Wadden Sea and the surrounding wetlands. During migration seasons, you can spot numerous migratory birds here, including geese, waders, and ducks. Bring your binoculars and enjoy the spectacle of colorful birds foraging and resting in this important bird sanctuary. It's a paradise for birdwatchers and nature lovers.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Vogeluitkijk op de dijk bietet Vogelliebhabern eine hervorragende Gelegenheit, verschiedene Vogelarten in ihrem natürlichen Lebensraum zu beobachten. Das Aussichtspunkt auf der Deich bietet einen Panoramablick auf die Waddenzee und die umliegenden Feuchtgebiete. Während der Zugvogelsaison kann man hier zahlreiche Zugvögel beobachten, darunter Gänse, Watvögel und Enten. Bringen Sie Ihr Fernglas mit und genießen Sie das Schauspiel bunter Vögel, die in diesem wichtigen Vogelschutzgebiet nach Nahrung suchen und rasten. Es ist ein Paradies für Vogelbeobachter und Naturliebhaber.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4718b974cb2998dd1112",name:"Natuurgebied Normerven",name_en:" Nature reserve Normerven",name_de:"Naturschutzgebiet Normerven",coordinates:"52.90712513906179, 4.938923552162519",description:"\u003Cp\u003ENatuurgebied Normerven is een waardevol natuurgebied op Wieringen. Dit unieke gebied bestaat uit veenplassen, rietlanden en moerasbossen. Het is een ideale plek om te wandelen en te genieten van de rust en stilte van de natuur. Het gebied biedt een thuis aan diverse planten- en diersoorten, waaronder zeldzame vogels en bijzondere planten. Breng een bezoek aan Natuurgebied Normerven en laat je betoveren door de ongerepte schoonheid van dit bijzondere stukje natuur.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ENormerven Nature Reserve is a valuable natural area on Wieringen. This unique area consists of peat ponds, reed lands, and marshy forests. It is an ideal place for hiking and enjoying the tranquility of nature. The area is home to various plant and animal species, including rare birds and special plants. Pay a visit to Normerven Nature Reserve and be enchanted by the unspoiled beauty of this exceptional piece of nature.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDas Natuurgebied Normerven ist ein wertvolles Naturgebiet auf Wieringen. Dieses einzigartige Gebiet besteht aus Torfseen, Schilfland und Sumpfwäldern. Es ist ein idealer Ort zum Wandern und Genießen der Ruhe der Natur. Das Gebiet beherbergt verschiedene Pflanzen- und Tierarten, darunter seltene Vögel und besondere Pflanzen. Besuchen Sie das Natuurgebied Normerven und lassen Sie sich von der unberührten Schönheit dieses besonderen Stücks Natur verzaubern.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee474eb974cb2998dd1113",name:"Marskepoeltjes",coordinates:"52.91248375346352, 4.951064414139313",description:g,description_en:g,description_de:g,enabled:a,category:b},{id:"62ee4768b974cb2998dd1114",name:"Kooibos bij Hippo",coordinates:"52.900039264946685, 4.968273697843227",description:"\u003Cp\u003EHet Kooibos bij Hippo dankt zijn naam aan de eendenkooi die hier in de 17e eeuw is aangelegd. Sinds 1973 beheert Staatsbosbeheer dit prachtige bosgebied. Het Kooibos is vooral belangrijk als natuurgebied vanwege de bijzondere plantengroei. Wandel door het bos en ontdek de verscheidenheid aan flora en fauna. Het is een ideale plek voor natuurliefhebbers, vogelspotters en wandelaars die de rust en schoonheid van de natuur willen ervaren.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EKooibos near Hippo gets its name from the duck decoy that was established here in the 17th century. Since 1973, Staatsbosbeheer (State Forestry Service) has been managing this beautiful forest area. The Kooibos is particularly important as a nature reserve due to its unique plant growth. Stroll through the forest and discover the variety of flora and fauna. It is an ideal spot for nature enthusiasts, birdwatchers, and hikers who want to experience the tranquility and beauty of nature.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDas Kooibos bei Hippo verdankt seinen Namen der Entenfanganlage, die hier im 17. Jahrhundert angelegt wurde. Seit 1973 verwaltet Staatsbosbeheer (der Staatliche Forstdienst) dieses wunderschöne Waldgebiet. Das Kooibos ist besonders wichtig als Naturschutzgebiet aufgrund seiner einzigartigen Pflanzenwelt. Schlendern Sie durch den Wald und entdecken Sie die Vielfalt an Flora und Fauna. Es ist ein idealer Ort für Naturliebhaber, Vogelbeobachter und Wanderer, die die Ruhe und Schönheit der Natur erleben möchten.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4781b974cb2998dd1115",name:"'t Witte Bruggetje",name_en:"'t Witte Bruggetje (The White Bridge)",name_de:" 't Witte Bruggetje (Die Weiße Brücke)",coordinates:"52.89247690857845, 4.9765819418689645",description:"\u003Cp\u003E't Witte Bruggetje is een charmante witte brug die het pittoreske Wieringen met het vasteland verbindt. Deze historische brug is een geliefde locatie voor wandelaars en biedt prachtige uitzichten over het water en het omliggende landschap. Bewonder de schilderachtige omgeving en geniet van de rust en sereniteit die deze plek te bieden heeft. Het 't Witte Bruggetje is ook een populaire plek om foto's te maken vanwege zijn authentieke charme en unieke uitstraling.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003E't Witte Bruggetje is a charming white bridge that connects picturesque Wieringen to the mainland. This historical bridge is a beloved spot for walkers and offers stunning views over the water and surrounding landscape. Admire the scenic surroundings and savor the tranquility and serenity that this place has to offer. 't Witte Bruggetje is also a popular spot for photography due to its authentic charm and unique appearance.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E't Witte Bruggetje ist eine charmante weiße Brücke, die das malerische Wieringen mit dem Festland verbindet. Diese historische Brücke ist ein beliebter Ort für Spaziergänger und bietet atemberaubende Ausblicke über das Wasser und die umliegende Landschaft. Bewundern Sie die malerische Umgebung und genießen Sie die Ruhe und Gelassenheit, die dieser Ort bietet. 't Witte Bruggetje ist auch ein beliebter Ort für Fotografie aufgrund seines authentischen Charmes und seiner einzigartigen Erscheinung.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee479eb974cb2998dd1116",name:"Kobus' Gemaaltje",coordinates:"52.89572949634843, 4.979786290020994",description:"\u003Cp\u003EKobus' Gemaaltje is een charmant klein gemaal dat vroeger werd gebruikt om water uit het gebied te pompen. Het is een herinnering aan de vroegere methoden van waterbeheer en irrigatie op Wieringen. Bezoekers kunnen hier het historische gemaal bewonderen en leren hoe het vroeger functioneerde. Kobus' Gemaaltje is een uniek stukje technisch erfgoed dat de geschiedenis van de waterhuishouding van het eiland belicht.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EKobus' Gemaaltje is a charming little pumping station that was used in the past to pump water from the area. It serves as a reminder of the former methods of water management and irrigation on Wieringen. Visitors can admire the historic pumping station and learn how it used to function. Kobus' Gemaaltje is a unique piece of technical heritage that highlights the history of water management on the island.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EKobus' Gemaaltje ist eine charmante kleine Pumpstation, die früher verwendet wurde, um Wasser aus der Umgebung zu pumpen. Es erinnert an die früheren Methoden der Wasserbewirtschaftung und Bewässerung auf Wieringen. Besucher können hier die historische Pumpstation bewundern und erfahren, wie sie früher funktioniert hat. Kobus' Gemaaltje ist ein einzigartiges Stück technisches Erbe, das die Geschichte der Wasserwirtschaft auf der Insel beleuchtet.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee47b8b974cb2998dd1117",name:"Hippolytushoever Koog",coordinates:"52.899649842101375, 4.979826839203257",description:"\u003Cp\u003EDit gebied ligt tussen Oosterklief en de Elft ten zuiden van de N99. Het is een open weidelandschap dat uitstekend geschikt is voor weidevogels. Het wordt doorsneden door de Hippolytushoeverkruisweg die een prachtig uitzicht biedt over het gehele gebied.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThis area is located between Oosterklief and the Elft south of the N99. It is an open meadow landscape that is excellent for meadow birds. It is intersected by the Hippolytushoeverkruisweg, which offers a beautiful view of the entire area.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDieses Gebiet liegt zwischen Oosterklief und dem Elft südlich der N99. Es handelt sich um eine offene Wiesenlandschaft, die sich hervorragend für Wiesenvögel eignet. Es wird vom Hippolytushoeverkruisweg gekreuzt, der einen schönen Blick auf das gesamte Gebiet bietet.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee47f1b974cb2998dd1118",name:"Info Oude Zeedijk 'Wierdijk'",coordinates:"52.909578579180945, 4.989193782310755",enabled:a,category:b},{id:"62ee4821b974cb2998dd1119",name:"'T Kraaiegat",coordinates:"52.92868292264288, 4.9677479970615135",enabled:a,category:b},{id:"62ee4854b974cb2998dd111a",name:"Uitkijktoren",coordinates:"52.93058751038826, 4.972814308317939",enabled:a,category:b},{id:"62ee486fb974cb2998dd111b",name:"Oude Zeewering",coordinates:"52.931911761262874, 4.9817769603410325",description:"\u003Cp\u003EDe Oude Zeewering is een historische dijk die ooit het eiland Wieringen beschermde tegen de kracht van de zee. Hoewel de dijk zijn oorspronkelijke functie heeft verloren, blijft het een belangrijk erfgoed en een herinnering aan het verleden. Tegenwoordig biedt de Oude Zeewering een prachtige wandelroute met uitzicht op de Waddenzee en het omliggende landschap. Geniet van de rustige omgeving terwijl je wandelt over deze bijzondere dijk en ontdek de rijke geschiedenis van Wieringen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Old Sea Dike, once protected the island of Wieringen from the power of the sea. Although the dike has lost its original function, it remains an important heritage and a reminder of the past. Today, the Old Sea Dike offers a beautiful walking route with views of the Wadden Sea and the surrounding landscape. Enjoy the peaceful environment while walking along this remarkable dike and discover the rich history of Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Oude Zeewering ist ein historischer Deich, der einst die Insel Wieringen vor der Kraft des Meeres schützte. Obwohl der Deich seine ursprüngliche Funktion verloren hat, bleibt er ein wichtiges Kulturerbe und eine Erinnerung an die Vergangenheit. Heute bietet die Oude Zeewering eine wunderschöne Wanderstrecke mit Blick auf das Wattenmeer und die umliegende Landschaft. Genießen Sie die ruhige Umgebung während Sie entlang dieses bemerkenswerten Deichs wandern und entdecken Sie die reiche Geschichte von Wieringen.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee487fb974cb2998dd111c",name:"Vatrop",coordinates:"52.93061005503834, 4.98573103092149",description:"\u003Cp\u003EVatrop is een idyllisch gehucht op Wieringen, gelegen tussen de uitgestrekte weilanden en omringd door rust en natuur. Het is een perfecte plek om te ontsnappen aan de drukte en te genieten van de landelijke charme van Wieringen. Wandel door de schilderachtige straatjes, bewonder de oude boerderijen en geniet van de serene omgeving. In de lente worden de velden om Vatrop bedekt met kleurrijke bloemen, wat zorgt voor een betoverend schouwspel. Bezoek Vatrop en laat je betoveren door de landelijke pracht van dit verborgen juweeltje.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EVatrop is an idyllic hamlet on Wieringen, nestled amidst vast meadows and surrounded by tranquility and nature. It's a perfect place to escape the hustle and bustle and relish the rural charm of Wieringen. Stroll through the picturesque lanes, admire the old farmhouses, and enjoy the serene ambiance. In spring, the fields around Vatrop are covered with colorful flowers, creating an enchanting spectacle. Visit Vatrop and be enchanted by the rural splendor of this hidden gem.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EVatrop ist ein idyllisches Dorf auf Wieringen, das zwischen weiten Wiesen liegt und von Ruhe und Natur umgeben ist. Es ist ein perfekter Ort, um dem Trubel zu entfliehen und den ländlichen Charme von Wieringen zu genießen. Schlendern Sie durch die malerischen Gassen, bewundern Sie die alten Bauernhäuser und genießen Sie die friedliche Atmosphäre. Im Frühling sind die Felder um Vatrop mit bunten Blumen bedeckt, was ein bezauberndes Schauspiel bietet. Besuchen Sie Vatrop und lassen Sie sich von der ländlichen Pracht dieses versteckten Juwels verzaubern.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee48a8b974cb2998dd111d",name:"Stroeër Koog",coordinates:"52.918954248649534, 4.980201420989235",description:"\u003Cp\u003EStroeër Koog is een prachtig natuurgebied op Wieringen dat bekend staat om zijn weidse uitzichten en diverse vogelsoorten. Het gebied bestaat uit moerassen, plassen en graslanden, en biedt een ideale habitat voor vele vogels. Vogelliefhebbers zullen hier zeker aan hun trekken komen, want je kunt hier verschillende soorten waadvogels, eenden en andere watervogels spotten. Maak een ontspannen wandeling door Stroeër Koog en geniet van de rust en de natuurlijke schoonheid van dit bijzondere gebied.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EStroeër Koog is a beautiful nature reserve on Wieringen, renowned for its expansive views and diverse bird species. The area comprises marshes, ponds, and grasslands, providing an ideal habitat for numerous birds. Bird enthusiasts will surely be delighted, as Stroeër Koog offers sightings of various wading birds, ducks, and other waterfowl. Take a leisurely walk through Stroeër Koog and enjoy the tranquility and natural beauty of this unique area.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Stroeër Koog ist ein wunderschönes Naturschutzgebiet auf Wieringen, das für seine weiten Ausblicke und vielfältigen Vogelarten bekannt ist. Das Gebiet besteht aus Mooren, Teichen und Wiesen und bietet einen idealen Lebensraum für zahlreiche Vögel. Vogelliebhaber werden hier sicher auf ihre Kosten kommen, da der Stroeër Koog verschiedene Watvögel, Enten und andere Wasservögel bietet. Machen Sie einen entspannten Spaziergang durch den Stroeër Koog und genießen Sie die Ruhe und die natürliche Schönheit dieses einzigartigen Gebiets.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee48cbb974cb2998dd111e",name:"Polder Waardnieuwland",coordinates:"52.90903723833209, 4.998819726338872",description:"\u003Cp\u003EPolder Waardnieuwland is een uitgestrekt en vruchtbaar landbouwgebied op Wieringen. Deze polder is ontstaan door landaanwinning en inpoldering en heeft een lange geschiedenis van agrarische activiteiten. Tijdens een wandeling of fietstocht door de polder kun je genieten van het weidse landschap en de rustgevende omgeving. Bewonder de uitgestrekte velden, kleurrijke bloemenpracht en de grazende dieren. Polder Waardnieuwland biedt een vleugje landelijke charme en is een ideale plek om te ontspannen en te genieten van het platteland van Wieringen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EWaardnieuwland Polder is an extensive and fertile agricultural area on Wieringen. This polder was reclaimed from the sea and has a long history of agricultural activities. During a walk or bike ride through the polder, you can enjoy the vast landscape and the peaceful environment. Admire the expansive fields, colorful flowers, and grazing animals. Waardnieuwland Polder offers a touch of rural charm and is an ideal place to relax and enjoy the countryside of Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Polder Waardnieuwland ist ein ausgedehntes und fruchtbares landwirtschaftliches Gebiet auf Wieringen. Dieser Polder wurde durch Landgewinnung und Eindeichung geschaffen und hat eine lange Geschichte landwirtschaftlicher Aktivitäten. Während eines Spaziergangs oder einer Radtour durch den Polder können Sie die weite Landschaft und die friedliche Umgebung genießen. Bewundern Sie die ausgedehnten Felder, die bunten Blumenpracht und die weidenden Tiere. Die Polder Waardnieuwland bietet einen Hauch von ländlichem Charme und ist ein idealer Ort zum Entspannen und Genießen der Landschaft von Wieringen.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee48dfb974cb2998dd111f",name:"Vis Kringloop",coordinates:"52.90235160335398, 5.011106582694135",description:"\u003Cp\u003EDe Vis Kringloop is een educatieve attractie op Wieringen die de levenscyclus van vis in de Waddenzee laat zien. Het biedt inzicht in de migratie en voortplanting van verschillende vissoorten, en hoe ze zich aanpassen aan de getijden en omgeving. Het bezoekerscentrum biedt interactieve tentoonstellingen, aquariums met lokale vissoorten en informatieve presentaties. Leer meer over de visserijgeschiedenis van de regio en het belang van duurzaam beheer van visbestanden. Een bezoek aan de Vis Kringloop is zowel leuk als leerzaam voor het hele gezin.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Fish Cycle is an educational attraction on Wieringen that showcases the life cycle of fish in the Wadden Sea. It provides insights into the migration and reproduction of different fish species and how they adapt to tides and their environment. The visitor center offers interactive exhibits, aquariums with local fish species, and informative presentations. Learn more about the fishing history of the region and the importance of sustainable fish stock management. A visit to the Fish Cycle is both fun and educational for the whole family.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Vis Kringloop ist eine lehrreiche Attraktion auf Wieringen, die den Lebenszyklus von Fischen in der Waddenzee zeigt. Sie bietet Einblicke in die Migration und Fortpflanzung verschiedener Fischarten und wie sie sich an Gezeiten und ihre Umgebung anpassen. Das Besucherzentrum bietet interaktive Ausstellungen, Aquarien mit lokalen Fischarten und informative Präsentationen. Erfahren Sie mehr über die Fischereigeschichte der Region und die Bedeutung einer nachhaltigen Fischbestandsbewirtschaftung. Ein Besuch in der Vis Kringloop ist sowohl für die ganze Familie unterhaltsam als auch lehrreich.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4915b974cb2998dd1120",name:"Robbenoordbos",coordinates:"52.89974715653432, 5.038325583852444",description:"\u003Cp\u003ERobbenoordbos is een prachtig bosgebied op Wieringen dat oorspronkelijk is aangeplant als productiebos. Tegenwoordig is het een populaire plek voor wandelaars en natuurliefhebbers. Het bos biedt een verscheidenheid aan wandelpaden waar je kunt genieten van de rust en sereniteit van de natuur. Onderweg kom je diverse flora en fauna tegen. Ontdek de mooie bossfeer, luister naar het gezang van vogels en laat je betoveren door de schoonheid van Robbenoordbos.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003ERobbenoord Forest is a beautiful wooded area on Wieringen that was originally planted as a production forest. Today, it is a popular spot for hikers and nature enthusiasts. The forest offers a variety of walking trails where you can enjoy the tranquility and serenity of nature. Along the way, you'll encounter various flora and fauna. Discover the enchanting forest atmosphere, listen to the birds' songs, and be captivated by the beauty of Robbenoord Forest.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Robbenoordbos ist ein wunderschönes Waldgebiet auf Wieringen, das ursprünglich als Nutzwald angelegt wurde. Heutzutage ist es ein beliebter Ort für Wanderer und Naturliebhaber. Der Wald bietet eine Vielzahl von Wanderwegen, auf denen Sie die Ruhe und Gelassenheit der Natur genießen können. Unterwegs begegnen Ihnen verschiedene Flora und Fauna. Entdecken Sie die bezaubernde Waldatmosphäre, lauschen Sie dem Gesang der Vögel und lassen Sie sich von der Schönheit des Robbenoordbos verzaubern.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4953b974cb2998dd1121",name:"Dijkgatbos",name_en:"",coordinates:"52.88959913932523, 5.069725719013265",description:"\u003Cp\u003EDijkgatbos is een betoverend bos dat bekend staat om zijn diverse flora en fauna. Het bos is ontstaan in een voormalig dijkgat, wat het zijn unieke karakter geeft. Bezoekers kunnen hier genieten van prachtige wandelingen tussen de bomen en langs schilderachtige waterpartijen. Het Dijkgatbos is ook een populaire plek voor vogelspotters, aangezien het een toevluchtsoord is voor verschillende vogelsoorten. Een ideale bestemming voor natuurliefhebbers en rustzoekers.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EDijkgat Forest is an enchanting forest known for its diverse flora and fauna. The forest originated in a former dike breach, which gives it its unique character. Visitors can enjoy beautiful walks among the trees and along picturesque water features. Dijkgat Forest is also a popular spot for birdwatchers, as it serves as a refuge for various bird species. An ideal destination for nature enthusiasts and those seeking tranquility.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDijkgatbos ist ein zauberhafter Wald, der für seine vielfältige Flora und Fauna bekannt ist. Der Wald entstand in einem ehemaligen Deichbruch, was ihm seinen einzigartigen Charakter verleiht. Besucher können hier schöne Spaziergänge zwischen den Bäumen und entlang malerischer Wasserpartien genießen. Dijkgatbos ist auch ein beliebter Ort für Vogelbeobachter, da es als Rückzugsort für verschiedene Vogelarten dient. Ein ideales Reiseziel für Naturliebhaber und Ruhesuchende.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4975b974cb2998dd1122",name:"Het Wierholt",coordinates:"52.901436208992386, 5.048928685673996",description:"\u003Cp\u003EEen mooi gevarieerd ommetje in een half open natuurgebied, ’t Wierholt. Het is in 2005 door Staatsbosbeheer aangelegd op een vuilstort, met golvende paadjes en een heuse heuvel met uitkijkpunt richting het IJsselmeer – een bijzondere wandeling.\u003C\u002Fp\u003E\u003Cp\u003EHonden zijn aangelijnd welkom. De route is in 2 richtingen gemarkeerd met groene pijlen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EA beautifully varied detour in a semi-open nature reserve, 't Wierholt. It was built in 2005 by Staatsbosbeheer on a landfill, with undulating paths and a real hill with a viewpoint towards the IJsselmeer - a special walk.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDogs are welcome on a lead. The route is marked in 2 directions with green arrows.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EEin wunderschön abwechslungsreicher Abstecher in ein halboffenes Naturschutzgebiet, 't Wierholt. Es wurde 2005 von Staatsbosbeheer auf einer Mülldeponie gebaut, mit hügeligen Wegen und einem echten Hügel mit Aussichtspunkt auf das IJsselmeer – ein besonderer Spaziergang.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EHunde sind an der Leine willkommen. Die Route ist in zwei Richtungen mit grünen Pfeilen markiert.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4987b974cb2998dd1123",name:"Gat in de Dijk",name_en:"Gap in the Dyke",name_de:" Loch im Deich",coordinates:"52.892917473472146, 5.074653988265094",description:"\u003Cp\u003EIn 1945 blies de Duitse bezetter ter hoogte van de Wieringermeer de IJsselmeerdijk op teneinde de achterliggende polder onder water te zetten en de opmars van de geallieerde troepen te hinderen. Direct achter de opgeblazen dijk zorgde het instromende water voor diepe kolkgaten, ook wel wielen genoemd. Nadat de dijk was gerepareerd en de Wieringermeer weer droge voeten had, resteerden twee lange smalle waterplassen en ontstond het natuurgebied De Wielen, druk bevolkt door o.a. watervogels. Bij de wielen is een uitkijkpunt ingericht, vanwaar de watervogels goed zijn te observeren. Rond de waterpartijen mooie wandelroutes, o.a. in het Dijkgatbos.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EIn 1945, the German occupier blew up the IJsselmeer dike near the Wieringermeer in order to flood the polder behind and hinder the advance of the Allied troops. Directly behind the blown-up dike, the inflowing water created deep gully holes, also known as wheels. After the dike was repaired and the Wieringermeer had dry feet again, two long narrow ponds remained and the De Wielen nature reserve was created, which is heavily populated by water birds, among other things. A vantage point has been set up near the wheels, from where the waterfowl can be observed well. Beautiful walking routes around the water features, including in the Dijkgatbos.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003E1945 sprengte der deutsche Besatzer den IJsselmeerdeich nahe dem Wieringermeer, um den dahinter liegenden Polder zu überfluten und den Vormarsch der alliierten Truppen zu behindern. Direkt hinter dem gesprengten Deich entstanden durch das einströmende Wasser tiefe Rinnen, auch Räder genannt. Nachdem der Deich repariert war und das Wieringermeer wieder trockene Füße hatte, blieben zwei lange schmale Teiche übrig und es entstand das Naturschutzgebiet De Wielen, das unter anderem stark von Wasservögeln bevölkert ist. In der Nähe der Räder wurde ein Aussichtspunkt eingerichtet, von dem aus man die Wasservögel gut beobachten kann. Schöne Wanderrouten rund um die Wasserspiele, auch im Dijkgatbos.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee49aab974cb2998dd1124",name:"Mountainbike route",coordinates:"52.88282535741905, 5.080824402407162",description:"\u003Cp\u003EDe mountainbikeroute Dijkgatbos is een gevarieerde route bestaande uit singletracks. De totale route is circa 20 kilometer lang en bestaat uit 3 secties die met elkaar verbonden zijn door zogenaamde verbindingsstukken. Deze 3 secties hebben ieder een eigen kleur routeaanduiding en zijn ook afzonderlijk te rijden als korter alternatief.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Dijkgatbos mountain bike route is a varied route consisting of single tracks. The total route is approximately 20 kilometers long and consists of 3 sections that are connected to each other by so-called connecting pieces. These 3 sections each have their own color route indication and can also be driven separately as a shorter alternative.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Dijkgatbos-Mountainbike-Route ist eine abwechslungsreiche Route, die aus Singletrails besteht. Die Gesamtstrecke ist etwa 20 Kilometer lang und besteht aus 3 Abschnitten, die durch sogenannte Verbindungsstücke miteinander verbunden sind. Diese 3 Abschnitte verfügen jeweils über eine eigene farbige Streckenmarkierung und können als kürzere Alternative auch einzeln befahren werden.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee49beb974cb2998dd1125",name:"Marina Den Oever",coordinates:"52.92438965540562, 5.046058456751461",description:"\u003Cp\u003EJachthaven Marina Den Oever BV is een gezellige, beschutte haven direct gelegen aan het IJsselmeer, de Waddenzee en de Noordzee. Het is een ideale uitvalsbasis voor een weekend of een vakantie met de boot op zowel zoet als zout water. De haven biedt moderne voorzieningen en faciliteiten voor boten van verschillende formaten. Daarnaast zijn er diverse restaurants en winkels in de buurt om van te genieten. Geniet van het prachtige uitzicht op het water en beleef een ontspannen en avontuurlijke tijd bij Marina Den Oever.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EMarina Den Oever is a cozy, sheltered harbor directly located at the IJsselmeer, the Wadden Sea, and the North Sea. It is an ideal base for a weekend or a vacation with the boat on both fresh and saltwater. The harbor offers modern amenities and facilities for boats of various sizes. In addition, there are several restaurants and shops nearby to enjoy. Experience the beautiful waterfront views and have a relaxing and adventurous time at Marina Den Oever.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Jachthaven Marina Den Oever BV ist ein gemütlicher, geschützter Hafen direkt am IJsselmeer, der Wattenmeer und der Nordsee gelegen. Es ist ein idealer Ausgangspunkt für ein Wochenende oder einen Urlaub mit dem Boot auf Süß- und Salzwasser. Der Hafen bietet moderne Annehmlichkeiten und Einrichtungen für Boote verschiedener Größen. Darüber hinaus gibt es verschiedene Restaurants und Geschäfte in der Nähe, die zum Genießen einladen. Erleben Sie die wunderschöne Aussicht auf das Wasser und verbringen Sie eine entspannte und abenteuerliche Zeit in Marina Den Oever.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee49cfb974cb2998dd1126",name:"Strand Zuiderhaven",name_en:"Beach Zuiderhaven",coordinates:"52.931518603434775, 5.0395901309070075",description:"\u003Cp\u003EHet Strand Zuiderhaven is een schilderachtig zandstrand aan de zuidelijke haven van Den Oever. Het strand is een ideale plek om te ontspannen, te zonnebaden, of een verfrissende duik te nemen in het IJsselmeer. De omgeving biedt een prachtig uitzicht op de haven en de omliggende natuur. Na een dagje op het strand kun je heerlijk genieten van een maaltijd in een van de nabijgelegen restaurants. Het Strand Zuiderhaven is de perfecte plek om te ontsnappen aan de drukte en te genieten van de rust en schoonheid van de omgeving.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EZuiderhaven Beach is a picturesque sandy beach located on the southern harbor of Den Oever. The beach is an ideal spot to relax, sunbathe, or take a refreshing dip in the IJsselmeer. The area offers beautiful views of the harbor and the surrounding nature. After a day at the beach, you can indulge in a meal at one of the nearby restaurants. Zuiderhaven Beach is the perfect place to escape the hustle and bustle and enjoy the tranquility and beauty of the surroundings.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Strand Zuiderhaven ist ein malerischer Sandstrand am südlichen Hafen von Den Oever. Der Strand ist ein idealer Ort zum Entspannen, Sonnenbaden oder ein erfrischendes Bad im IJsselmeer zu nehmen. Die Umgebung bietet einen wunderschönen Blick auf den Hafen und die umliegende Natur. Nach einem Tag am Strand können Sie in einem der nahegelegenen Restaurants köstlich speisen. Der Strand Zuiderhaven ist der perfekte Ort, um dem Trubel zu entfliehen und die Ruhe und Schönheit der Umgebung zu genießen.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee49dbb974cb2998dd1127",name:"Zeesluis",coordinates:"52.93403408418654, 5.042000395739004",description:"\u003Cp\u003EDe Zeesluis is een belangrijk waterwerk op Wieringen, dat de verbinding vormt tussen de Waddenzee en het achterland. Deze sluis speelt een cruciale rol bij het beheersen van het waterpeil en het reguleren van de waterstromen. Bezoekers kunnen hier getuige zijn van hoe schepen de sluis passeren en hoe het waterpeil wordt aangepast om een veilige doorgang te garanderen. Het is een interessante plek om meer te leren over de waterbeheersing in het gebied en de maritieme geschiedenis van Wieringen. Kom naar de Zeesluis en ervaar de bedrijvigheid van dit belangrijke waterwerk.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Sea Lock is an important water structure on Wieringen, forming the connection between the Wadden Sea and the hinterland. This lock plays a crucial role in water level management and regulating water flows. Visitors can witness how ships pass through the lock and how the water level is adjusted to ensure safe passage. It is an interesting place to learn more about water management in the area and the maritime history of Wieringen. Come to the Sea Lock and experience the activity of this significant water structure.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Zeesluis ist ein wichtiges Wasserbauwerk auf Wieringen, das die Verbindung zwischen der Waddenzee und dem Hinterland bildet. Diese Schleuse spielt eine entscheidende Rolle in der Wasserstandsregulierung und der Regelung des Wasserflusses. Besucher können hier miterleben, wie Schiffe die Schleuse passieren und wie der Wasserstand angepasst wird, um einen sicheren Durchgang zu gewährleisten. Es ist ein interessanter Ort, um mehr über das Wassermanagement in der Region und die maritime Geschichte von Wieringen zu erfahren. Kommen Sie zur Zeesluis und erleben Sie die Aktivität dieses bedeutenden Wasserbauwerks.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee49ebb974cb2998dd1128",name:"Spuisluizen",coordinates:"52.936125339382905, 5.046100364203987",description:"\u003Cp\u003EDe Spuisluizen zijn belangrijke waterwerken op Wieringen, die het waterpeil reguleren en zorgen voor de afvoer van overtollig water uit het achterliggende poldergebied. Deze sluizen spelen een cruciale rol bij het beheersen van het water in de regio en het voorkomen van overstromingen. Naast hun functionele waarde bieden de Spuisluizen ook een interessante bezienswaardigheid voor bezoekers. Kom naar de Spuisluizen en bewonder deze indrukwekkende waterwerken terwijl je leert over hun essentiële rol in de Nederlandse watermanagementgeschiedenis.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Spuisluizen are important water structures on Wieringen, regulating water levels and ensuring the drainage of excess water from the hinterland polder area. These sluices play a crucial role in water management in the region and in preventing flooding. Besides their functional significance, the Spuisluizen also serve as an interesting sight for visitors. Come to the Spuisluizen and admire these impressive water structures while learning about their essential role in Dutch water management history.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Spuisluizen sind wichtige Wasserbauwerke auf Wieringen, die den Wasserstand regulieren und für die Entwässerung des überschüssigen Wassers aus dem dahinterliegenden Poldergebiet sorgen. Diese Schleusen spielen eine entscheidende Rolle im Wassermanagement der Region und bei der Verhinderung von Überschwemmungen. Neben ihrer funktionalen Bedeutung sind die Spuisluizen auch eine interessante Sehenswürdigkeit für Besucher. Besuchen Sie die Spuisluizen und bewundern Sie diese beeindruckenden Wasserbauwerke, während Sie mehr über ihre essenzielle Rolle in der Geschichte des niederländischen Wasserbaus erfahren.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4a10b974cb2998dd1129",name:"Duitse bunker",name_en:"German Bunker",name_de:"Deutscher Bunker",coordinates:"52.93703334753622, 5.040764018008853",description:"\u003Cp\u003EDe Duitse bunker is een overblijfsel uit de Tweede Wereldoorlog en herinnert aan de bezetting van Wieringen. Deze historische bunker biedt een kijkje in het verleden en is een gedenkwaardige locatie om te bezoeken. Verken het interieur en leer meer over de geschiedenis van dit bouwwerk. De Duitse bunker is een belangrijk cultureel erfgoed dat de herinnering aan een donkere periode levendig houdt.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe German Bunker is a relic from World War II and serves as a reminder of the occupation of Wieringen. This historical bunker offers a glimpse into the past and is a memorable site to visit. Explore the interior and learn more about the history of this structure. The German Bunker is an important cultural heritage that keeps the memory of a dark period alive.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer deutsche Bunker ist ein Relikt aus dem Zweiten Weltkrieg und erinnert an die Besetzung von Wieringen. Dieser historische Bunker bietet einen Einblick in die Vergangenheit und ist eine denkwürdige Stätte zu besichtigen. Erforschen Sie das Innere und erfahren Sie mehr über die Geschichte dieses Bauwerks. Der deutsche Bunker ist ein wichtiges Kulturerbe, das die Erinnerung an eine dunkle Zeit lebendig hält.\u003C\u002Fp\u003E",enabled:a,category:b},{id:"62ee4a2ab974cb2998dd112a",name:"Natuurgebied Het Schor",name_en:"Nature reserve Het Schor",name_de:"Naturschutzgebiet Het Schor",coordinates:"52.93769220088095, 5.025170149416869",description:"\u003Cp\u003EHet Schor is een overgangsgebied tussen de Waddenzee en de vaste wal. Het ontstond na de aanleg van de Afsluitdijk en de aanpassingen bij de dijken van de haven.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDe vegetatie op Het Schor is heel divers, van 'gras' tot zilte groenten zoals zeekraal en lamsoor. Tijdens de excursie van het Wadvissergilde wordt het gebied gevoeld, geroken en geproefd. De planten krijgen te maken met droogtes, maar ook met drijfnatte periodes. Niet alleen door zoete regen, maar ook door zout zeewater.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EEr leeft van alles op Het Schor, maar de meest opvallende zijn de vogels. Zij vinden in dit gebied rust en ruimte om te leven en te overleven. Maar ook plankton, slakjes, garnalen en visjes vinden hun weg bij Het Schor en tussen de planten vind je vele soorten insecten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDe omgeving van Het Schor is bijzonder, aan de ene kant de Waddenzee met haar natuurpracht en aan de andere kant het heuvelachtige landschap van het oude Wieringerland. Een landschap om van te genieten.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe Schor is a transitional area between the Wadden Sea and the mainland. It emerged after the construction of the Afsluitdijk and adjustments to the harbor's dikes.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EThe vegetation at Het Schor is very diverse, ranging from 'grasses' to salty vegetables such as samphire and sea lavender. During the excursions by the Wadvissergilde, visitors can feel, smell, and taste the area. The plants experience both dry periods and wet periods. Not only due to fresh rain but also from salty seawater.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EMany creatures inhabit Het Schor, but the most remarkable are the birds. They find peace and space to live and survive in this area. Additionally, plankton, snails, shrimps, and small fish find their way at Het Schor, and numerous types of insects can be found among the plants.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EThe environment surrounding Het Schor is remarkable, with the natural splendor of the Wadden Sea on one side and the hilly landscape of old Wieringerland on the other. A landscape to enjoy.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDer Schor ist ein Übergangsbereich zwischen Wattenmeer und Festland. Es entstand nach dem Bau des Abschlussdeichs und den Anpassungen der Deiche des Hafens.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDie Vegetation bei Het Schor ist sehr vielfältig, von „Gras“ bis hin zu salzigen Gemüsesorten wie Queller und Seeflieder. Während des Ausflugs der Wadvissergilde kann man die Gegend spüren, riechen und schmecken. Die Pflanzen müssen mit Dürreperioden, aber auch mit klatschnassen Perioden klarkommen. Nicht nur durch süßen Regen, sondern auch durch salziges Meerwasser.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAuf Het Schor lebt alles, aber am auffälligsten sind die Vögel. Sie finden in dieser Gegend Frieden und Raum zum Leben und Überleben. Aber auch Plankton, Schnecken, Garnelen und Fische finden ihren Weg nach Het Schor und unter den Pflanzen finden Sie viele Arten von Insekten.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDie Umgebung von Het Schor ist etwas Besonderes, einerseits das Wattenmeer mit seiner natürlichen Schönheit und andererseits die Hügellandschaft des alten Wieringerlandes. Eine Landschaft zum Genießen.\u003C\u002Fp\u003E",enabled:a,category:b},c,e,{id:"653811749b1f7ffbe34b2d07",name:"Startpunt Walking Wieringen by Night",name_en:"Start Walking Wieringen by Night",name_de:" Startpunkt Walking Wieringen by Night",coordinates:"52.93299101445433, 5.010093006943562",description:"\u003Cp\u003EHet evenement “\u003Ca href=\"https:\u002F\u002Fwalkingwieringen.nl\u002F\" rel=\"noopener noreferrer\" target=\"_blank\"\u003EWalking Wieringen By Night\u003C\u002Fa\u003E” vindt plaats op 23 maart 2024. De wandeling is 18 kilometer. Laat u tijdens de wandeling verrassen door het mooie afwisselende landschap van Wieringen dat ook nog eens mooi verlicht zal worden.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EDe start en finish zijn bij het scouting gebouw in Oosterland aan de Keizerspoeldijk. We vertrekken in groepen per 10 minuten. Het vertrek vindt tussen 19:00 en 20:10 plaats. Houdt uw starttijd aan, u mag wel later starten maar niet eerder!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVanaf de A7: Neem afslag Den Oever\u002FDen Helder. Ga bij Den Oever rechtdoor over de rotonde. Neem bij de volgende rotonde de eerste afslag (richting Oosterland). Volg de Akkerweg tot u niet meer verder kunt. Sla dan linksaf de Gemeenelandsweg in en direct weer rechts de Keizerspoeldijk in. Het scoutinggebouw ziet u aan uw rechterhand vlak voor de bocht.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternatief: Rij de rotonde van Den Oever 3 kwart rond. Rij rechtdoor (niet met de weg mee naar rechts) over de Gesterweg \u002F Martekrogt. Rij helemaal door tot u niet meer verder kunt. Sla linksaf de Molgerdijk in. Neem de eerste weg rechts, Keizerspoeldijk. De ingang van het scoutinggebouw\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EN99 vanuit Den Helder: Ga rechtdoor over de twee rotondes bij Hippolytushoef, neem daarna de eerste afslag links (Kleitelweg), rij een klein stukje door het buurtschap Smerp, tot de kruising. Sla rechtsaf. Rij rechtdoor over de Gemeenelandsweg tot u in Oosterland aankomt. Daar neemt u de derde weg links, de Keizerspoeldijk. Het scoutinggebouw ziet u aan uw rechterhand vlak voor de bocht.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternatief: Ga rechtdoor over de twee rotondes bij Hippolytushoef. Neem de derde afslag bij de volgende rotonde (Oosterland). Volg de Akkerweg tot u niet meer verder kan. Sla dan linksaf de Gemeenelandsweg in en direct weer rechts de Keizerspoeldijk in. Het scoutinggebouw ziet u aan uw rechterhand vlak voor de bocht\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThe event “\u003Ca href=\"https:\u002F\u002Fwalkingwieringen.nl\u002F\" rel=\"noopener noreferrer\" target=\"_blank\"\u003EWalking Wieringen By Night\u003C\u002Fa\u003E” will take place on March 23, 2024. The walk is 18 kilometers. During the walk, be surprised by the beautiful, varied landscape of Wieringen, which will also be beautifully illuminated.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EThe start and finish are at the scouting building in Oosterland on the Keizerspoeldijk. We leave in groups every 10 minutes. Departure takes place between 7:00 PM and 8:10 PM. Keep to your starting time, you can start later but not earlier!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EFrom the A7: Take the Den Oever\u002FDen Helder exit. At Den Oever go straight ahead over the roundabout. At the next roundabout take the first exit (direction Oosterland). Follow the Akkerweg until you can go no further. Then turn left into Gemeenelandsweg and immediately right again into Keizerspoeldijk. You will see the scouting building on your right just before the bend.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternative: Drive 3 quarters around the Den Oever roundabout. Drive straight ahead (do not follow the road to the right) over the Gesterweg \u002F Martekrogt. Drive all the way until you can go no further. Turn left onto Molgerdijk. Take the first road on the right, Keizerspoeldijk. The entrance to the scouting building\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EN99 from Den Helder: Go straight ahead over the two roundabouts at Hippolytushoef, then take the first exit on the left (Kleitelweg), drive a short distance through the hamlet of Smerp, until the intersection. Turn right. Drive straight on along the Gemeenelandsweg until you arrive in Oosterland. There you take the third road on the left, the Keizerspoeldijk. You will see the scouting building on your right just before the bend.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternative: Go straight across the two roundabouts at Hippolytushoef. Take the third exit at the next roundabout (Oosterland). Follow the Akkerweg until you can go no further. Then turn left into Gemeenelandsweg and immediately right again into Keizerspoeldijk. You will see the scouting building on your right just before the bend\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDie Veranstaltung „\u003Ca href=\"https:\u002F\u002Fwalkingwieringen.nl\u002F\" rel=\"noopener noreferrer\" target=\"_blank\"\u003EWalking Wieringen By Night\u003C\u002Fa\u003E“ findet am 23. März 2024 statt. Die Wanderung ist 18 Kilometer lang. Lassen Sie sich während des Spaziergangs von der wunderschönen, abwechslungsreichen Landschaft Wieringens überraschen, die zudem wunderschön beleuchtet wird.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EStart und Ziel sind beim Scouting-Gebäude in Oosterland am Keizerspoeldijk. Wir fahren alle 10 Minuten in Gruppen los. Die Abfahrt erfolgt zwischen 19:00 und 20:10 Uhr. Halten Sie Ihre Startzeit ein, Sie können später beginnen, aber nicht früher!\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EVon der A7: Nehmen Sie die Ausfahrt Den Oever\u002FDen Helder. In Den Oever fahren Sie geradeaus über den Kreisverkehr. Am nächsten Kreisverkehr nehmen Sie die erste Ausfahrt (Richtung Oosterland). Folgen Sie dem Akkerweg, bis es nicht mehr weitergeht. Biegen Sie dann links in den Gemeenelandsweg und sofort wieder rechts in den Keizerspoeldijk ein. Kurz vor der Kurve sehen Sie das Pfadfindergebäude auf der rechten Seite.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternative: Fahren Sie 3 Viertel um den Kreisverkehr Den Oever herum. Fahren Sie geradeaus (nicht der Straße nach rechts folgen) über den Gesterweg \u002F Martekrogt. Fahren Sie den ganzen Weg, bis es nicht mehr weitergeht. Biegen Sie links ab auf Molgerdijk. Nehmen Sie die erste Straße rechts, Keizerspoeldijk. Der Eingang zum Pfadfindergebäude\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EN99 von Den Helder: Fahren Sie geradeaus über die beiden Kreisverkehre bei Hippolytushoef, nehmen Sie dann die erste Ausfahrt links (Kleitelweg) und fahren Sie ein kurzes Stück durch den Weiler Smerp bis zur Kreuzung. Biegen Sie rechts ab. Fahren Sie geradeaus auf dem Gemeenelandsweg, bis Sie in Oosterland ankommen. Dort nehmen Sie die dritte Straße links, den Keizerspoeldijk. Kurz vor der Kurve sehen Sie das Pfadfindergebäude auf der rechten Seite.\u003C\u002Fp\u003E\u003Cp\u003E\u003Cbr\u003E\u003C\u002Fp\u003E\u003Cp\u003EAlternative: Fahren Sie geradeaus über die beiden Kreisverkehre bei Hippolytushoef. Nehmen Sie am nächsten Kreisverkehr die dritte Ausfahrt (Oosterland). Folgen Sie dem Akkerweg, bis es nicht mehr weitergeht. Biegen Sie dann links in den Gemeenelandsweg und sofort wieder rechts in den Keizerspoeldijk ein. Kurz vor der Kurve sehen Sie das Pfadfindergebäude auf der rechten Seite\u003C\u002Fp\u003E",enabled:a,category:b}],routes:[{id:"64b9a29d4b72a00df704c8f8",startPoint:e,name:"Haven Route",description:"\u003Cp\u003EMaak een onvergetelijke wandeling langs de schilderachtige haven van Den Oever op het prachtige Wieringen. Deze betoverende route biedt een unieke ervaring waarbij je kunt genieten van het bruisende maritieme leven en de natuurlijke schoonheid van de omgeving. Wandel langs de kades en bewonder de kleurrijke vissersboten die rustig dobberen op het water. De haven van Den Oever is ook een ideale plek om verse vis te proeven en te genieten van de lokale gastronomie. Onderweg kom je langs gezellige restaurants en cafés met uitzicht op het water. De wandeling biedt tevens prachtige vergezichten over het Waddenzee-landschap. Ontdek de charme van de haven van Den Oever tijdens deze onvergetelijke wandeling op Wieringen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an unforgettable walk along the picturesque harbor of Den Oever on the beautiful island of Wieringen. This enchanting route offers a unique experience where you can enjoy the bustling maritime life and the natural beauty of the surroundings. Stroll along the quays and admire the colorful fishing boats peacefully bobbing on the water. The harbor of Den Oever is also an ideal place to taste fresh fish and savor the local cuisine. Along the way, you'll pass cozy restaurants and cafes with waterfront views. The walk also provides beautiful panoramas of the Wadden Sea landscape. Discover the charm of the harbor of Den Oever during this unforgettable hike on Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen unvergesslichen Spaziergang entlang des malerischen Hafens von Den Oever auf der schönen Insel Wieringen. Diese bezaubernde Route bietet ein einzigartiges Erlebnis, bei dem Sie das geschäftige maritime Leben und die natürliche Schönheit der Umgebung genießen können. Schlendern Sie entlang der Kais und bewundern Sie die farbenfrohen Fischerboote, die friedlich auf dem Wasser schaukeln. Der Hafen von Den Oever ist auch ein idealer Ort, um frischen Fisch zu kosten und die lokale Küche zu genießen. Unterwegs passieren Sie gemütliche Restaurants und Cafés mit Blick auf das Wasser. Der Spaziergang bietet auch wunderschöne Panoramen der Landschaft der Wattenmeer-Region. Entdecken Sie den Charme des Hafens von Den Oever während dieser unvergesslichen Wanderung auf Wieringen.\u003C\u002Fp\u003E",file:"haven",km:"4.5",image:"haven.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fhavenroute-rood\u002F56403",isWalk:a,startingPointId:f},{id:"64b9a3a34b72a00df704c8fa",startPoint:c,name:"Westerklief Route",description:"\u003Cp\u003EMaak een adembenemende wandeling over Westerklief, een bijzondere locatie op het betoverende Wieringen. Deze route biedt wandelaars een unieke kans om te genieten van het schilderachtige landschap en de rijke geschiedenis van de regio. Een van de hoogtepunten van de wandeling is de imposante Zwerfkei, een indrukwekkende zwerfsteen die eeuwen geleden door gletsjers is achtergelaten. Bewonder de prachtige natuurlijke omgeving terwijl je je een weg baant over kronkelende paden en door pittoreske dorpjes. Westerklief heeft ook een rijke archeologische geschiedenis, en tijdens je wandeling kun je genieten van de mysterieuze sfeer die dit gebied omgeeft. Mis deze unieke wandelervaring over Westerklief op Wieringen niet!\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on a breathtaking walk over Westerklief, a unique location on the enchanting island of Wieringen. This route offers hikers a unique opportunity to enjoy the picturesque landscape and rich history of the region. One of the highlights of the walk is the impressive Zwerfkei, an imposing glacial erratic left behind by glaciers centuries ago. Admire the beautiful natural surroundings as you make your way through winding paths and picturesque villages. Westerklief also has a rich archaeological history, and during your walk, you can immerse yourself in the mysterious atmosphere that surrounds this area. Don't miss this unique hiking experience over Westerklief on Wieringen!\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen atemberaubenden Spaziergang über Westerklief, einen einzigartigen Ort auf der zauberhaften Insel Wieringen. Diese Route bietet Wanderern eine einzigartige Gelegenheit, die malerische Landschaft und die reiche Geschichte der Region zu genießen. Einer der Höhepunkte des Spaziergangs ist die beeindruckende Zwerfkei, ein imposanter Findling, der vor Jahrhunderten von Gletschern zurückgelassen wurde. Bewundern Sie die wunderschöne Naturumgebung, während Sie sich Ihren Weg durch verwinkelte Pfade und malerische Dörfer bahnen. Westerklief hat auch eine reiche archäologische Geschichte, und während Ihres Spaziergangs können Sie in die geheimnisvolle Atmosphäre eintauchen, die dieses Gebiet umgibt. Verpassen Sie nicht dieses einzigartige Wandererlebnis über Westerklief auf Wieringen!\u003C\u002Fp\u003E",file:"westerklief",km:"4.7",image:"westerklief.jpeg",isBike:h,isWalk:a,startingPointId:d},{id:"64b99fd54b72a00df704c8f3",startPoint:c,name:"Wierdijk Route",description:"\u003Cp\u003EMaak een onvergetelijke wandeling over de Wierdijk op het prachtige Wieringen. Deze schilderachtige route biedt een unieke ervaring waarbij je kunt genieten van adembenemende uitzichten over de Waddenzee en het omliggende landschap. De Wierdijk, een historisch dijksysteem dat ooit cruciaal was voor de bescherming tegen de zee, is nu een geliefde plek voor wandelaars en natuurliefhebbers. Langs de dijk kom je langs charmante dorpjes en oude molens, die een glimp bieden van het rijke verleden van deze regio. Ontdek de geschiedenis, cultuur en natuur tijdens deze bijzondere wandeling over de Wierdijk.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an unforgettable walk along the Wierdijk on the beautiful island of Wieringen. This picturesque route offers a unique experience where you can enjoy breathtaking views of the Wadden Sea and the surrounding landscape. The Wierdijk, a historical dike system that was once crucial for protecting against the sea, is now a beloved spot for hikers and nature enthusiasts. Along the dike, you'll pass charming villages and ancient windmills, offering a glimpse into the rich heritage of this region. Discover history, culture, and nature during this extraordinary walk along the Wierdijk.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen unvergesslichen Spaziergang entlang der Wierdijk auf der schönen Insel Wieringen. Diese malerische Route bietet ein einzigartiges Erlebnis, bei dem Sie atemberaubende Ausblicke auf das Wattenmeer und die umliegende Landschaft genießen können. Die Wierdijk, ein historisches Deichsystem, das einst entscheidend für den Schutz vor der Nordsee war, ist heute ein beliebter Ort für Wanderer und Naturliebhaber. Entlang des Deiches passieren Sie charmante Dörfer und alte Windmühlen, die einen Einblick in das reiche Erbe dieser Region bieten. Entdecken Sie Geschichte, Kultur und Natur während dieses außergewöhnlichen Spaziergangs entlang der Wierdijk.\u003C\u002Fp\u003E",file:"wierdijk",km:"7",image:"wierdijk.jpg",isBike:h,isWalk:a,startingPointId:d},{id:"64b99f174b72a00df704c8f1",startPoint:c,name:i,description:j,description_en:k,description_de:l,file:"stroe-bike",km:"8",image:m,isBike:a,startingPointId:d},{id:"64b99f534b72a00df704c8f2",startPoint:c,name:i,description:j,description_en:k,description_de:l,file:"stroe",km:"8.3",image:m,isWalk:a,startingPointId:d},{id:"64b9a1c04b72a00df704c8f6",startPoint:e,name:"Oosterland Route",description:"\u003Cp\u003EMaak een betoverende wandeling door het pittoreske Oosterland op het charmante Wieringen. Deze unieke route biedt wandelaars de mogelijkheid om te genieten van de rustige schoonheid van het platteland en de rijke geschiedenis van dit gebied. Onderweg kom je langs historische boerderijen, schilderachtige landweggetjes en traditionele Nederlandse windmolens die het landschap sieren. Oosterland staat bekend om zijn authentieke sfeer en cultureel erfgoed. Bewonder de idyllische omgeving en geniet van de landelijke rust tijdens deze onvergetelijke wandeling. Verken de verborgen pareltjes van Oosterland op Wieringen en laat je verrassen door de charme van dit historische dorp.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an enchanting walk through the picturesque Oosterland on the charming island of Wieringen. This unique route offers hikers the opportunity to enjoy the tranquil beauty of the countryside and the rich history of this area. Along the way, you'll pass historical farms, scenic country lanes, and traditional Dutch windmills that adorn the landscape. Oosterland is known for its authentic atmosphere and cultural heritage. Admire the idyllic surroundings and savor the rural tranquility during this unforgettable hike. Explore the hidden gems of Oosterland on Wieringen and be amazed by the charm of this historic village.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EUnternehmen Sie einen bezaubernden Spaziergang durch das malerische Oosterland auf der charmanten Insel Wieringen. Diese einzigartige Route bietet Wanderern die Möglichkeit, die ruhige Schönheit der Landschaft und die reiche Geschichte dieser Region zu genießen. Unterwegs passieren Sie historische Bauernhöfe, malerische Landstraßen und traditionelle holländische Windmühlen, die die Landschaft schmücken. Oosterland ist bekannt für seine authentische Atmosphäre und sein kulturelles Erbe. Bewundern Sie die idyllische Umgebung und genießen Sie die ländliche Ruhe während dieser unvergesslichen Wanderung. Entdecken Sie die versteckten Schätze von Oosterland auf Wieringen und lassen Sie sich von dem Charme dieses historischen Dorfes verzaubern.\u003C\u002Fp\u003E",file:"oosterland",km:"9.7",image:"oosterland.jpg",url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Foosterlandroute-blauw\u002F56405",isBike:a,isWalk:a,startingPointId:f},{id:"64b9a3034b72a00df704c8f9",startPoint:c,name:"Quarantaine Route",description:"\u003Cp\u003EMaak een fascinerende wandeling langs de Quarantaine Weg op het prachtige Wieringen en ontdek de geschiedenis en unieke bezienswaardigheden. De Quarantaine Weg, ooit gebruikt als route voor het isoleren van zieke zeelieden, biedt tegenwoordig een schilderachtige wandelervaring. Tijdens deze route kom je langs historische gebouwen, zoals het voormalige quarantainegebouw en andere overblijfselen uit het verleden. Geniet van de rustige omgeving, het weidse uitzicht over het landschap en de sfeer van vervlogen tijden. De wandeling op de Quarantaine Weg is een reis door het rijke maritieme verleden van Wieringen die je niet wilt missen.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on a fascinating walk along the Quarantine Road on the beautiful island of Wieringen and discover its history and unique landmarks. The Quarantine Road, once used as a route to isolate sick sailors, now offers a picturesque hiking experience. Along this route, you'll pass historical buildings, such as the former quarantine station and other remnants of the past. Enjoy the peaceful surroundings, the expansive views of the landscape, and the ambiance of bygone times. The walk on the Quarantine Road is a journey through Wieringen's rich maritime history that you don't want to miss.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen faszinierenden Spaziergang entlang der Quarantaine Straße auf der schönen Insel Wieringen und entdecken Sie ihre Geschichte und einzigartige Sehenswürdigkeiten. Die Quarantaine Straße, einst als Route zur Isolierung kranker Seeleute genutzt, bietet heute ein malerisches Wandererlebnis. Entlang dieser Route passieren Sie historische Gebäude wie die ehemalige Quarantänestation und andere Überreste der Vergangenheit. Genießen Sie die ruhige Umgebung, den weiten Blick über die Landschaft und das Ambiente vergangener Zeiten. Der Spaziergang auf der Quarantaine Straße ist eine Reise durch die reiche maritime Geschichte von Wieringen, die Sie nicht verpassen sollten.\u003C\u002Fp\u003E",file:"quarantaine",km:"12",image:"quarantaine.jpg",isBike:a,startingPointId:d},{id:"64c2d4d7313e32c40a7d3a98",startPoint:e,name:"Gat in de dijk -route",description:"\u003Cp\u003EDeze prachtige fietsroute begint in het pittoreske Den Oever en voert je door het betoverende Robbenoordbos om uiteindelijk bij Het Gat in de Dijk te eindigen. Onderweg fiets je langs schilderachtige landschappen, historische plekken en natuurlijke schoonheid. Het Gat in de Dijk heeft een bijzondere betekenis vanwege de gebeurtenissen tijdens de Tweede Wereldoorlog, waarbij de dijk werd opgeblazen en de Wieringermeer onder water kwam te staan. Nu is dit gebied omgetoverd tot natuurgebied 'De Wielen' met de restanten van een boerderij die hier vroeger stond. Op de oude dijk vind je een toegangspad met een uitkijkpunt, waar je een prachtig uitzicht hebt op het water met daarop de fundering van de voormalige boerderij.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EThis beautiful cycling route starts in the picturesque town of Den Oever and takes you through the enchanting Robbenoord Forest, culminating at Het Gat in de Dijk (The Hole in the Dike). Along the way, you'll pass by scenic landscapes, historic sites, and natural beauty. Het Gat in de Dijk holds a special significance due to the events during World War II when the dike was blown up, causing the Wieringermeer to flood. Today, this area has transformed into a nature reserve called 'De Wielen,' with the remnants of a farmhouse that once stood there. On the old dike, a pathway leads to an observation point where you can enjoy a splendid view of the water, showcasing the foundation of the former farmhouse.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EDiese wunderschöne Fahrradroute beginnt im malerischen Den Oever und führt durch den bezaubernden Robbenoordbos, um schließlich am Het Gat in de Dijk (Das Loch im Deich) zu enden. Unterwegs passieren Sie malerische Landschaften, historische Stätten und natürliche Schönheit. Het Gat in de Dijk hat eine besondere Bedeutung aufgrund der Ereignisse während des Zweiten Weltkriegs, als der Deich gesprengt wurde und das Wieringermeer überflutet wurde. Heute ist dieses Gebiet zu einem Naturreservat namens 'De Wielen' geworden, mit den Überresten eines Bauernhauses, das einst hier stand. Auf dem alten Deich führt ein Weg zu einem Aussichtspunkt, von dem aus Sie einen herrlichen Blick auf das Wasser haben und die Grundmauern des ehemaligen Bauernhauses sehen können.\u003C\u002Fp\u003E",file:"gatindedijk",km:"14",image:"gatindedijk.jpg",isBike:a,startingPointId:f},{id:"64b9a0bc4b72a00df704c8f4",startPoint:c,name:"Amstelmeer Route",description:"\u003Cp\u003E\u003Cspan style=\"color: rgba(255, 255, 255, 0.7);\"\u003EMaak een betoverende wandeling rond het schilderachtige Amstelmeer, gelegen naast het eiland Wieringen. Deze adembenemende route biedt wandelaars een unieke gelegenheid om te genieten van de serene schoonheid van het meer en het omliggende landschap. Tijdens de wandeling ontdek je de diverse flora en fauna van dit natuurgebied en kun je genieten van prachtige uitzichten over het water. Langs het Amstelmeer zijn er ook interessante bezienswaardigheden, zoals historische dijken en pittoreske dorpjes, die je een kijkje geven in het rijke verleden van deze regio. Laat je betoveren door de natuurlijke pracht en historische charme tijdens deze wandeling rond het Amstelmeer naast Wieringen.\u003C\u002Fspan\u003E\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EEmbark on an enchanting walk around the picturesque Amstelmeer, located next to the island of Wieringen. This breathtaking route offers hikers a unique opportunity to enjoy the serene beauty of the lake and the surrounding landscape. During the walk, you'll discover the diverse flora and fauna of this nature reserve and indulge in stunning views over the water. Along the Amstelmeer, there are also interesting landmarks such as historical dikes and picturesque villages, providing a glimpse into the rich history of this region. Let yourself be captivated by the natural beauty and historical charm during this walk around the Amstelmeer next to Wieringen.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EMachen Sie einen bezaubernden Spaziergang rund um das malerische Amstelmeer, das neben der Insel Wieringen liegt. Diese atemberaubende Route bietet Wanderern eine einzigartige Gelegenheit, die ruhige Schönheit des Sees und der umliegenden Landschaft zu genießen. Während des Spaziergangs entdecken Sie die vielfältige Flora und Fauna dieses Naturschutzgebiets und können atemberaubende Ausblicke über das Wasser genießen. Entlang des Amstelmeers gibt es auch interessante Sehenswürdigkeiten wie historische Deiche und malerische Dörfer, die einen Einblick in die reiche Geschichte dieser Region bieten. Lassen Sie sich von der natürlichen Schönheit und dem historischen Charme bei diesem Spaziergang rund um das Amstelmeer neben Wieringen verzaubern.\u003C\u002Fp\u003E",file:"amstelmeer",km:"22",image:"amstelmeer.jpg",isBike:a,isWalk:a,startingPointId:d},{id:"64b9a2334b72a00df704c8f7",startPoint:e,name:"Willibrord Route",description:"\u003Cp\u003EStap in de voetsporen van de heilige Willibrord en maak een betoverende pelgrimswandeling op het prachtige Wieringen. Rond het jaar 700 werd op Stroe, een idyllisch buurtschap op Wieringen, een kerkje gebouwd, vermoedelijk door de heilige Willibrord zelf. Na verloop van tijd werd het houten kerkje vervangen door een gebouw van tufsteen, waarin een gevelsteen met de afbeelding van een varken, een heidens symbool, te vinden was. In 2016 is de Heidense Kapel op Stroe herbouwd en vormt nu een rustpunt voor pelgrims om even bij te komen en een stempel in hun wandelboekje te zetten. Deze pelgrimswandeling biedt niet alleen een unieke historische ervaring maar ook prachtige landschappen en charmante dorpen die de heilige Willibrord ooit heeft doorkruist.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EWalk in the footsteps of Saint Willibrord and embark on an enchanting pilgrimage on the beautiful island of Wieringen. Around the year 700, a small church was built in Stroe, an idyllic hamlet on Wieringen, believed to have been constructed by Saint Willibrord himself. Over time, the wooden church was replaced by a tuff stone building with a gable stone depicting a pig, a symbol of pagan origin. In 2016, the Heidense Kapel (Heathen Chapel) in Stroe was reconstructed, now serving as a resting point for pilgrims to take a break and stamp their pilgrimage booklets. This pilgrimage walk not only offers a unique historical experience but also showcases beautiful landscapes and charming villages that Saint Willibrord once traversed.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EFolgen Sie den Fußspuren des heiligen Willibrord und begeben Sie sich auf eine zauberhafte Pilgerwanderung auf der schönen Insel Wieringen. Um das Jahr 700 wurde in Stroe, einem idyllischen Weiler auf Wieringen, eine kleine Kirche erbaut, die vermutlich vom heiligen Willibrord persönlich errichtet wurde. Im Laufe der Zeit wurde die hölzerne Kirche durch ein Gebäude aus Tuffstein ersetzt, in dem sich ein Giebelstein mit der Abbildung eines Schweins, einem Symbol heidnischer Herkunft, befand. Im Jahr 2016 wurde die Heidense Kapel (Heidentempel) in Stroe wiederaufgebaut und dient nun als Ruhepunkt für Pilger, um eine Pause einzulegen und ihre Pilgerbücher zu stempeln. Diese Pilgerwanderung bietet nicht nur ein einzigartiges historisches Erlebnis, sondern zeigt auch wunderschöne Landschaften und charmante Dörfer, die der heilige Willibrord einst durchquerte.\u003C\u002Fp\u003E",file:"willibrord",km:"26.8",image:n,url:"https:\u002F\u002Fwww.wandelnetwerknoordholland.nl\u002Fstartpunten\u002Froute\u002Fin-het-voetspoor-van-de-heilige-willibrord\u002F83791",isWalk:a,startingPointId:f},{id:"64b9a1384b72a00df704c8f5",startPoint:c,name:"Wieringen Route",description:"\u003Cp\u003EBeleef een magische wandeling rondom het voormalige eiland Wieringen en ontdek de rijke geschiedenis en adembenemende bezienswaardigheden. Deze betoverende route neemt je mee op een reis door de tijd terwijl je geniet van het prachtige landschap en de natuurlijke schoonheid. Onderweg kom je langs historische dijken, schilderachtige dorpjes en oude kerken, die allemaal een verhaal vertellen over het verleden van deze bijzondere regio. De wandeling biedt ook panoramische uitzichten over het water en de omliggende natuur. Verken de unieke charme van het voormalige eiland Wieringen tijdens deze onvergetelijke wandeling.\u003C\u002Fp\u003E",description_en:"\u003Cp\u003EExperience a magical walk around the former island of Wieringen and discover its rich history and breathtaking landmarks. This enchanting route takes you on a journey through time while you enjoy the beautiful landscape and natural beauty. Along the way, you'll encounter historical dikes, picturesque villages, and ancient churches, all of which tell a story about the past of this remarkable region. The walk also offers panoramic views of the water and surrounding nature. Explore the unique charm of the former island of Wieringen during this unforgettable hike.\u003C\u002Fp\u003E",description_de:"\u003Cp\u003EErleben Sie einen zauberhaften Spaziergang rund um das ehemalige Eiland Wieringen und entdecken Sie seine reiche Geschichte und atemberaubende Sehenswürdigkeiten. Diese bezaubernde Route entführt Sie auf eine Reise durch die Zeit, während Sie die wunderschöne Landschaft und natürliche Schönheit genießen. Unterwegs stoßen Sie auf historische Deiche, malerische Dörfer und alte Kirchen, die alle eine Geschichte über die Vergangenheit dieser bemerkenswerten Region erzählen. Der Spaziergang bietet auch einen Panoramablick auf das Wasser und die umliegende Natur. Erkunden Sie den einzigartigen Charme des ehemaligen Eilands Wieringen während dieser unvergesslichen Wanderung.\u003C\u002Fp\u003E",file:"wieringen",km:"28",image:n,isBike:a,startingPointId:d}]}],fetch:[],mutations:[]}}(true,"Bezienswaardigheden",{},"64c172d41616be6f2ca590f0",{},"64c1734c1616be6f2ca590f1","\u003Cp\u003EMarskepoeltjes zijn kleine waterplassen en vormen een belangrijk natuurgebied op Wieringen. Deze plassen zijn ontstaan door het afgraven van veen voor turfwinning. Tegenwoordig zijn ze een waardevolle habitat voor verschillende vogelsoorten en andere dieren. Het gebied biedt tevens prachtige wandelmogelijkheden en uitkijkpunten om te genieten van de rust en natuur. Maak een ontspannen wandeling langs de Marskepoeltjes en laat je verrassen door de biodiversiteit van dit bijzondere stukje natuur.\u003C\u002Fp\u003E",false,"Stroe Route","\u003Cp\u003EOntdek het pittoreske Stroe op het eiland Wieringen met een betoverende wandeling langs historische bezienswaardigheden. Deze unieke route neemt je mee door schilderachtige landschappen en biedt een fascinerend inzicht in de rijke geschiedenis van deze regio. Verken charmante dorpjes, bewonder oude monumenten en geniet van adembenemende uitzichten over het landschap. Of je nu een natuurliefhebber bent of geïnteresseerd bent in cultureel erfgoed, deze wandeling door Stroe zal zeker een onvergetelijke ervaring zijn.\u003C\u002Fp\u003E","\u003Cp\u003EDiscover picturesque Stroe on the island of Wieringen with an enchanting walk along historical landmarks. This unique route takes you through scenic landscapes and offers a fascinating insight into the rich history of this region. Explore charming villages, admire ancient monuments, and enjoy breathtaking views of the countryside. Whether you're a nature enthusiast or interested in cultural heritage, this walk through Stroe will undoubtedly be an unforgettable experience.\u003C\u002Fp\u003E","\u003Cp\u003EEntdecken Sie das malerische Stroe auf der Insel Wieringen bei einem bezaubernden Spaziergang entlang historischer Sehenswürdigkeiten. Diese einzigartige Route führt Sie durch malerische Landschaften und bietet faszinierende Einblicke in die reiche Geschichte dieser Region. Erkunden Sie charmante Dörfer, bewundern Sie alte Denkmäler und genießen Sie atemberaubende Ausblicke auf die Landschaft. Ob Sie ein Naturliebhaber sind oder an kulturellem Erbe interessiert sind, dieser Spaziergang durch Stroe wird mit Sicherheit ein unvergessliches Erlebnis sein.\u003C\u002Fp\u003E","stroe.jpg","wieringen.jpg")));